   "source": [
    "library(data.table)\n",
    "library(dplyr)\n",
    "library(mice)\n",
    "\n",
    "train <- fread(\"/kaggle/input/titanic/train.csv\")\n",
    "\n",
    "imp <- mice(train, m = 1, \n",
    "            method = c(\"\", \"\", \"\", \"\", \"\", \"pmm\", \"\", \"\", \"\",\"\", \"\", \"\"))\n",
    "train <- complete(imp)                       \n",
    "densityplot(imp)\n",
    "\n",
    "train <- train %>% mutate(relateds=ifelse(train$SibSp > 0 | train$Parch > 0, 1, 0))\n",
    "\n",
    "logit <- glm(data=train, Survived ~ as.factor(Sex)*relateds + Age*relateds + as.factor(Pclass) + SibSp, \n",
    "             family = binomial('logit'))\n",
    "summary(logit)\n",
    "\n",
    "train <- train %>% mutate(pred=ifelse(logit$fitted.values >= 0.5, 1, 0))\n",
    "train <- train %>% mutate(acuracia=ifelse(train$Survived==train$pred, 1, 0))\n",
    "sum(train$acuracia)/891\n",
    "\n",
    "test <- fread(\"/kaggle/input/titanic/test.csv\")\n",
    "\n",
    "imp2 <- mice(test, m = 1, \n",
    "            method = c(\"\", \"\", \"\", \"\", \"pmm\", \"\", \"\", \"\",\"\", \"\", \"\"))\n",
    "test <- complete(imp2)                       \n",
    "densityplot(imp2)\n",
    "\n",
    "test <- test %>% mutate(relateds=ifelse(test$SibSp > 0 | test$Parch > 0, 1, 0))\n",
    "pred <- predict(logit, newdata = test, type='response')\n",
    "test <- test %>% mutate(Survived=ifelse(pred >= 0.5, 1, 0))\n",
    "\n",
    "fwrite(test[,c('PassengerId', 'Survived')], 'submission.csv')"
   ]
  }
